def common_prefix(strs: List[str]) -> str:
    if not strs:
        return ""
    # prefix can’t be longer than this word
    baseline = min(strs, key=len)          
    for i, ch in enumerate(baseline):
        for word in strs:
            # mismatch? prefix stops before i
            if word[i] != ch:              
                return baseline[:i]
    # whole shortest string is the prefix  
    return baseline

