def can_partition_k_subsets(nums, k):
    target, rem = divmod(sum(nums), k)
    if rem:
        return False
    nums.sort(reverse=True)
    buckets = [0] * k

    def dfs(idx):
        if idx == len(nums):
            return True
        for bucket in range(k):
            if buckets[bucket] + nums[idx] > target:
                continue
            buckets[bucket] += nums[idx]
            if dfs(idx + 1):
                return True
            buckets[bucket] -= nums[idx]
            if buckets[bucket] == 0:
                break  # symmetry pruning
        return False

    return dfs(0)

